import React from "react";
import { Link } from "react-router-dom";
import "./home.css";

const Navbar = () => {
  return (
    <>
      <div className="list">
        <div className="head">
          <h1>Weather App</h1>
        </div>
        <div>
          <ul>
            <li>
              <Link to="/home">Home</Link>
            </li>
            <li>
              <Link to="/search">Search</Link>
            </li>
          </ul>
        </div>
      </div>
    </>
  );
};

export default Navbar;
